DROP TABLE IF EXISTS customers CASCADE;
CREATE TABLE customers (
    customer_id VARCHAR(50) PRIMARY KEY,
    first_name VARCHAR(255),
    last_name VARCHAR(255),
    email VARCHAR(255),
    phone VARCHAR(255),
    ssn VARCHAR(255),
    date_of_birth DATE,
    address VARCHAR(255),
    city VARCHAR(255),
    state VARCHAR(255),
    zip_code INTEGER,
    employment_type VARCHAR(255),
    annual_income DECIMAL(15,2),
    created_date DATE,
    is_active BOOLEAN
);



















































